import React from 'react';
import {StyleSheet, Text, TouchableWithoutFeedback, View} from 'react-native';
import Svg, {Defs, Image, Path, Pattern, Use} from 'react-native-svg';
import {ThemeContext} from '../../context/UserSettings/ThemeContext';

export type ThemeType = 'light' | 'dark';

const LightThemeIcon = () => {
  return (
    <Svg width={30} height={30} fill="none">
      <Path fill="url(#a)" d="M0 0h30v30H0z" />
      <Defs>
        <Pattern
          id="a"
          patternContentUnits="objectBoundingBox"
          width={1}
          height={1}>
          <Use xlinkHref="#b" transform="scale(.00195)" />
        </Pattern>
        <Image
          id="b"
          width={512}
          height={512}
          xlinkHref="data:image/png;base64,"
        />
      </Defs>
    </Svg>
  );
};

const DarkThemeIcon = () => {
  return (
    <Svg width={30} height={30} fill="none">
      <Path fill="url(#a)" d="M0 0h24.151v25H0z" />
      <Defs>
        <Pattern
          id="a"
          patternContentUnits="objectBoundingBox"
          width={1}
          height={1}>
          <Use xlinkHref="#b" transform="scale(.00195 .00189)" />
        </Pattern>
        <Image
          id="b"
          width={512}
          height={530}
          xlinkHref="data:image/png;base64,"
        />
      </Defs>
    </Svg>
  );
};

const styles = StyleSheet.create({
  buttonContainer: {
    marginHorizontal: 17,
  },

  menuButton: {
    backgroundColor: '#2EC08C',
    padding: 10,
    borderRadius: 10,
    elevation: 5,
    // alignItems: 'flex-start',
  },

  menuText: {textAlign: 'center', marginTop: 5, fontWeight: '400'},
});

const ThemeIcon = () => {
  const {theme, toggleTheme} = React.useContext(ThemeContext);

  const icon = theme === 'light' ? <LightThemeIcon /> : <DarkThemeIcon />;

  return (
    <TouchableWithoutFeedback onPress={() => toggleTheme()}>
      <View style={styles.menuButton}>{icon}</View>
    </TouchableWithoutFeedback>
  );
};

export const ThemeButton = () => {
  return (
    <View style={styles.buttonContainer}>
      <ThemeIcon />
      <Text style={styles.menuText}>Theme</Text>
    </View>
  );
};
